      "description": {
        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eModule \u003ca\u003eNetwork.Curlhs.Base\u003c/a\u003e provides a direct low-level bindings to\n \u003ccode\u003elibcurl\u003c/code\u003e. It is basically a 1:1 mapping of the \u003ccode\u003elibcurl\u003c/code\u003e's C API,\n a direct translation of \"curl/curl.h\" header files to Haskell FFI.\n A higher level interface, without ubiquitous pointers and all of that\n C stuff, is provided through the module \u003ca\u003eNetwork.Curlhs.Core\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eDocumentation about the library and/or particular functions may be found\n in the \u003ccode\u003elibcurl\u003c/code\u003e's manual pages or on the \u003ccode\u003elibcurl\u003c/code\u003e's project site\n (\u003ca\u003ehttp://curl.haxx.se/libcurl/\u003c/a\u003e). Because API of this module mirrors API\n of the external library, particular symbols may exist or not,\n dependently of that, which version of \u003ccode\u003elibcurl\u003c/code\u003e is used during compilation\n of the package. The module as closely as possible tries to follow\n the original \u003ccode\u003elibcurl\u003c/code\u003e API. The main differences are in types of functions\n such as \u003ccode\u003ecurl_easy_setopt\u003c/code\u003e and \u003ccode\u003ecurl_easy_getinfo\u003c/code\u003e. Besides that all\n symbol names are prefixed with 'c' or 'C'. \n\u003c/p\u003e\u003cp\u003eAs the name of the module may suggest, this module is a basis for the\n rest of \u003ccode\u003ecurlhs\u003c/code\u003e package. For now exposed API is somewhat incomplete,\n still lacks some things (like the \"multi interface\"), but the aim is\n to provide here a complete API of \u003ccode\u003elibcurl\u003c/code\u003e, as defined in its C headers.\n\u003c/p\u003e\u003c/div\u003e",
        "fct-module": "Network.Curlhs.Base",
        "fct-package": "curlhs",
        "fct-signature": "module",
        "fct-source": "src/Network-Curlhs-Base.html",
        "fct-type": "module",
        "title": "Base"
      },
